import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { FaBicycle, FaFilter, FaStar, FaArrowRight } from 'react-icons/fa';
import axios from 'axios';
import './SaddleDesigns.css';

const SaddleDesigns = () => {
  const [saddles, setSaddles] = useState([]);
  const [filteredSaddles, setFilteredSaddles] = useState([]);
  const [loading, setLoading] = useState(true);
  const [selectedCategory, setSelectedCategory] = useState('All');
  const [searchTerm, setSearchTerm] = useState('');

  const categories = ['All', 'Racing', 'Comfort', 'Mountain', 'Gravel'];

  useEffect(() => {
    fetchSaddles();
  }, []);

  useEffect(() => {
    filterSaddles();
  }, [saddles, selectedCategory, searchTerm]);

  const fetchSaddles = async () => {
    try {
      const response = await axios.get('/api/saddles');
      setSaddles(response.data);
      setLoading(false);
    } catch (error) {
      console.error('Error fetching saddles:', error);
      setLoading(false);
    }
  };

  const filterSaddles = () => {
    let filtered = saddles;

    if (selectedCategory !== 'All') {
      filtered = filtered.filter(saddle => saddle.category === selectedCategory);
    }

    if (searchTerm) {
      filtered = filtered.filter(saddle =>
        saddle.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
        saddle.description.toLowerCase().includes(searchTerm.toLowerCase())
      );
    }

    setFilteredSaddles(filtered);
  };

  const handleCategoryChange = (category) => {
    setSelectedCategory(category);
  };

  const handleSearchChange = (e) => {
    setSearchTerm(e.target.value);
  };

  if (loading) {
    return (
      <div className="saddle-designs">
        <div className="container">
          <div className="loading-container">
            <div className="spinner"></div>
            <p>Loading saddle designs...</p>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="saddle-designs">
      <div className="container">
        {/* Header */}
        <div className="page-header">
          <h1>Choose Your Perfect Saddle</h1>
          <p>Browse our premium collection of bike saddle designs, each crafted for specific riding styles and comfort preferences</p>
        </div>

        {/* Filters */}
        <div className="filters">
          <div className="search-filter">
            <input
              type="text"
              placeholder="Search saddles..."
              value={searchTerm}
              onChange={handleSearchChange}
              className="search-input"
            />
          </div>
          
          <div className="category-filters">
            {categories.map(category => (
              <button
                key={category}
                className={`category-btn ${selectedCategory === category ? 'active' : ''}`}
                onClick={() => handleCategoryChange(category)}
              >
                {category}
              </button>
            ))}
          </div>
        </div>

        {/* Results Count */}
        <div className="results-info">
          <p>Showing {filteredSaddles.length} of {saddles.length} saddle designs</p>
        </div>

        {/* Saddles Grid */}
        <div className="saddles-grid">
          {filteredSaddles.map(saddle => (
            <div key={saddle.id} className="saddle-card">
              <div className="saddle-image">
                <img 
                  src={saddle.image} 
                  alt={`${saddle.name} saddle`}
                  onError={(e) => {
                    e.target.style.display = 'none';
                    e.target.nextSibling.style.display = 'flex';
                  }}
                />
                <div className="image-placeholder" style={{ display: 'none' }}>
                  <FaBicycle />
                  <span>{saddle.name}</span>
                </div>
                <div className="saddle-category">{saddle.category}</div>
              </div>
              
              <div className="saddle-content">
                <h3 className="saddle-name">{saddle.name}</h3>
                <p className="saddle-description">{saddle.description}</p>
                
                <div className="saddle-features">
                  <div className="feature">
                    <span className="feature-label">Category:</span>
                    <span className="feature-value">{saddle.category}</span>
                  </div>
                  <div className="feature">
                    <span className="feature-label">Price:</span>
                    <span className="feature-value price">${saddle.price}</span>
                  </div>
                </div>

                <div className="saddle-actions">
                  <Link 
                    to={`/order?saddleId=${saddle.id}`} 
                    className="btn btn-primary"
                  >
                    Order This Saddle
                    <FaArrowRight />
                  </Link>
                </div>
              </div>
            </div>
          ))}
        </div>

        {/* Empty State */}
        {filteredSaddles.length === 0 && (
          <div className="empty-state">
            <FaBicycle />
            <h3>No saddles found</h3>
            <p>Try adjusting your search or filter criteria</p>
            <button 
              className="btn btn-secondary"
              onClick={() => {
                setSelectedCategory('All');
                setSearchTerm('');
              }}
            >
              Clear Filters
            </button>
          </div>
        )}

        {/* CTA Section */}
        <div className="designs-cta">
          <div className="cta-content">
            <h2>Can't Find What You're Looking For?</h2>
            <p>We offer custom saddle modifications and can work with your specific requirements. Contact us to discuss your needs.</p>
            <Link to="/order" className="btn btn-primary">
              Start Custom Order
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SaddleDesigns;
